import React from "react";

class Nine extends React.Component{
        constructor(){
            super()

            this.state = {

                Name : "cc"
            }
        }
            changeState(){
                this.setState({
                    Name : "bb",
                })
            }

    render(){
        return(
            <div>
                <h1>{this.state = "memon"}{this.changeState()}</h1>
            </div>
        )
    }
}

export default Nine;
